import './back-arrow.styles.scss';

const BackArrow = () => {
  return (
    <button className="back-arrow-container">
      <svg viewBox="0 0 24 24" class="back-arrow">
        <path
          fill="currentColor"
          d="M20 11H7.83l5.59-5.59L12 4l-8 8 8 8 1.41-1.41L7.83 13H20v-2z"
        ></path>
      </svg>
    </button>
  );
};
export default BackArrow;
